import React from "react";

function LCVPDashboard() {
    return (
        <div className="flex min-h-screen">
            <div className="w-64 bg-white shadow-md p-6">
                <h1 className="text-2xl font-bold text-gray-800">LCVP Dashboard</h1>
                <nav className="mt-6">
                    <a className="block py-2 px-4 rounded hover:bg-gray-200" href="#">Home</a>
                    <a className="block py-2 px-4 rounded hover:bg-gray-200" href="#">Task Management</a>
                </nav>
            </div>

            <div className="flex-1 p-6">
                <h2 className="text-xl font-bold">Welcome, LCVP</h2>
                <p className="text-gray-600">Manage your teamâ€™s tasks and performance.</p>
            </div>
        </div>
    );
}

export default LCVPDashboard;
